import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import React, { useState, useEffect } from 'react';
import { Button, Spinner } from 'react-bootstrap';

function App() {
  const [two, setTwo] = useState(2);
  const [three, setThree] = useState(3);
  const [four, setFour] = useState(4);
  const [five, setFive] = useState(5);
  const [six, setSix] = useState(6);
  const [seven, setSeven] = useState(7);
  const [eight, setEight] = useState(8);
  const [nine, setNine] = useState(9);
  const [ten, setTen] = useState(10);
  const [eleven, setEleven] = useState(11);
  const [twelve, setTwelve] = useState(12);

  const maxDiceValue = 6;
  const minDiceValue = 1;

  const [dice1, setDice1] = useState(0);
  const [dice2, setDice2] = useState(0);

  const [rolling, setRolling] = useState(false);
  const [currentValue, setCurrentValue] = useState(null);
  const [possibleNumbers, setPossibleNumbers] = useState([]);
  const [hasPossibleCombination, setHasPossibleCombination] = useState(true);

  const handleDiceRoll = () => {
    setRolling(true);
    setTimeout(() => {
      let result1 = Math.floor(Math.random() * (maxDiceValue - minDiceValue + 1)) + minDiceValue;
      let result2 = Math.floor(Math.random() * (maxDiceValue - minDiceValue + 1)) + minDiceValue;

      setDice1(result1);
      setDice2(result2);

      let newValue = result1 + result2;
      setCurrentValue(newValue);

      checkPossibleNumbers(newValue);

      setRolling(false);
    }, 2000);
  };

  const checkPossibleNumbers = (value) => {
    let possibleNumbers = [];
    if (two !== false) possibleNumbers.push(2);
    if (three !== false) possibleNumbers.push(3);
    if (four !== false) possibleNumbers.push(4);
    if (five !== false) possibleNumbers.push(5);
    if (six !== false) possibleNumbers.push(6);
    if (seven !== false) possibleNumbers.push(7);
    if (eight !== false) possibleNumbers.push(8);
    if (nine !== false) possibleNumbers.push(9);
    if (ten !== false) possibleNumbers.push(10);
    if (eleven !== false) possibleNumbers.push(11);
    if (twelve !== false) possibleNumbers.push(12);

    let combinations = [];
    for (let i = 0; i < possibleNumbers.length; i++) {
      for (let j = i + 1; j < possibleNumbers.length; j++) {
        if (possibleNumbers[i] + possibleNumbers[j] === value) {
          combinations.push([possibleNumbers[i], possibleNumbers[j]]);
        }
      }
    }

    if (combinations.length > 0) {
      setHasPossibleCombination(true);
    } else {
      setHasPossibleCombination(false);
    }

    setPossibleNumbers(possibleNumbers);
  };

  const handleSelectNumber = (number) => {
    if (hasPossibleCombination) {
      switch (number) {
        case 2:
          setCurrentValue(currentValue - 2);
          setTwo(false);
          break;
        case 3:
          setCurrentValue(currentValue - 3);
          setThree(false);
          break;
        case 4:
          setCurrentValue(currentValue - 4);
          setFour(false);
          break;
        case 5:
          setCurrentValue(currentValue - 5);
          setFive(false);
          break;
        case 6:
          setCurrentValue(currentValue - 6);
          setSix(false);
          break;
        case 7:
          setCurrentValue(currentValue - 7);
          setSeven(false);
          break;
        case 8:
          setCurrentValue(currentValue - 8);
          setEight(false);
          break;
        case 9:
          setCurrentValue(currentValue - 9);
          setNine(false);
          break;
        case 10:
          setCurrentValue(currentValue - 10);
          setTen(false);
          break;
        case 11:
          setCurrentValue(currentValue - 11);
          setEleven(false);
          break;
        case 12:
          setCurrentValue(currentValue - 12);
          setTwelve(false);
          break;
        default:
          break;
      }

      checkPossibleNumbers(currentValue - number);
    }
  };

  return (
    <div>
      <Button variant={two ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !two} onClick={() => handleSelectNumber(2)}>{two ? ("2") : ("✔")}</Button>
      <Button variant={three ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !three} onClick={() => handleSelectNumber(3)}>{three ? ("3") : ("✔")}</Button>
      <Button variant={four ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !four} onClick={() => handleSelectNumber(4)}>{four ? ("4") : ("✔")}</Button>
      <Button variant={five ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !five} onClick={() => handleSelectNumber(5)}>{five ? ("5") : ("✔")}</Button>
      <Button variant={six ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !six} onClick={() => handleSelectNumber(6)}>{six ? ("6") : ("✔")}</Button>
      <Button variant={seven ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !seven} onClick={() => handleSelectNumber(7)}>{seven ? ("7") : ("✔")}</Button>
      <Button variant={eight ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !eight} onClick={() => handleSelectNumber(8)}>{eight ? ("8") : ("✔")}</Button>
      <Button variant={nine ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !nine} onClick={() => handleSelectNumber(9)}>{nine ? ("9") : ("✔")}</Button>
      <Button variant={ten ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !ten} onClick={() => handleSelectNumber(10)}>{ten ? ("10") : ("✔")}</Button>
      <Button variant={eleven ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !eleven} onClick={() => handleSelectNumber(11)}>{eleven ? ("11") : ("✔")}</Button>
      <Button variant={twelve ? "warning" : "success"} size="lg" disabled={!hasPossibleCombination || !twelve} onClick={() => handleSelectNumber(12)}>{twelve ? ("12") : ("✔")}</Button>
      <br />
      <Button variant="light">{rolling ? (<Spinner />) : (<h1>{dice1}</h1>)}</Button>
      <Button variant="light">{rolling ? (<Spinner />) : (<h1>{dice2}</h1>)}</Button>
      <br />
      <Button variant="info" disabled={rolling} onClick={handleDiceRoll}>Roll!</Button>
    </div>
  );
}

export default App;
